import { motion, AnimatePresence } from "framer-motion";

function SectionOne({ advanceState }) {
  return (
    <AnimatePresence>
      <div className="mx-auto text-5xl w-max leading-snug place-items-stretch">
        <motion.div
          initial={{ y: "-20%", opacity: 0 }}
          animate={{ y: "0%", opacity: 1 }}
          transition={{ ease: "easeOut", duration: 1, delay: 1 }}
        >
          SO,
        </motion.div>
        <motion.div
          initial={{ y: "-20%", opacity: 0 }}
          animate={{ y: "0%", opacity: 1 }}
          transition={{ ease: "easeOut", duration: 1, delay: 2 }}
        >
          YOU KNOW THAT
        </motion.div>
        <motion.div
          initial={{ y: "-20%", opacity: 0 }}
          animate={{ y: "0%", opacity: 1 }}
          transition={{ ease: "easeOut", duration: 1, delay: 3 }}
        >
          MUSIC IS CLASSIFIED
        </motion.div>
        <motion.div
          initial={{ y: "-20%", opacity: 0 }}
          animate={{ y: "0%", opacity: 1 }}
          transition={{ ease: "easeOut", duration: 1, delay: 4 }}
        >
          INTO <span className="italic font-serif">solid </span>
          CATEGORIES?
        </motion.div>
        <motion.div
          initial={{ x: "0%", y: "-20%", opacity: 0 }}
          animate={{ y: "0%", opacity: 1 }}
          transition={{ ease: "easeOut", duration: 1, delay: 5 }}
          whileHover={{ x: "20%" }}
          className="select-none w-min text-8xl hover:text-gray-200 animate-ping"
          onClick={advanceState}
        >
          â˜ž
        </motion.div>
      </div>
    </AnimatePresence>
  );
}

export default SectionOne;
